        lists.push(<li><a href={"/content/"+data.[i].id}></a></li>)
        i=i+1;

      }

      return(
        <nav>
            <ul>
                <li><a href="1.html"> HTML1 </a></li>
                <li><a href="2.html"> CSS 2</a></li>
                <li><a href="3.html"> JavaScript 3</a></li>
                <li><a href="3.html"> JavaScript 4</a></li>
            </ul>
          </nav>
      );
    }
  }

